import { TMessage } from "../models/message";
import { Request } from '../utils/requests/request';



export const apiSendMessage = async (phone: string, currentMessage: TMessage) => {
  const body = {
       chatId: phone + '@c.us',
       message: currentMessage.text,
  }
  return await Request('POST', 'sendMessage', body);
};

export const apiReceiveNotification = async () => {
  const result = await Request('GET', 'receiveNotification');
  return  result.json();
};
